const scriptURL =
  "https://script.google.com/macros/s/AKfycbyEMhxVdAiMUJ0SKTER6BYz0mPwCa4DlEeprEfmZNWiYUIGOwrNpEbLi6g8S5eTO7eyPA/exechttps://script.google.com/macros/s/AKfycbyEMhxVdAiMUJ0SKTER6BYz0mPwCa4DlEeprEfmZNWiYUIGOwrNpEbLi6g8S5eTO7eyPA/exec";
const form = document.forms["google-sheet"];

form.addEventListener("submit", (e) => {
  e.preventDefault();
  fetch(scriptURL, { method: "POST", body: new FormData(form) })
    .then((response) =>
      alert("Thanks for Booking Seat..! We Will Contact You Soon...")
    )
    .catch((error) => console.error("Error!", error.message));
});
